import React from 'react';
import styled from 'styled-components';
import SampleImage from './assets/images/sample-image.png'; // Mettez le bon chemin ici

const ImageContainer = styled.div`
  position: absolute;
  bottom: 20px;
  left: 20px;
  z-index: 100000; /* Pour s'assurer qu'il est au-dessus des autres éléments */
`;

const StaticImage = styled.img`
  width: 150px;
  height: auto;
  border: 2px solid black; /* Ajout d'une bordure pour visualiser l'image */
`;

const MainContent = ({ backgroundColor, setBackgroundColor }) => {
  return (
    <BackgroundContainer bgColor={backgroundColor}>
      {/* Autres éléments... */}

      <ImageContainer>
        <StaticImage src={SampleImage} alt="Sample" />
      </ImageContainer>
    </BackgroundContainer>
  );
};

export default MainContent;
